          <div className="col-sm-6 text-white footerIcon">
            <Link className="NavLink" to="/product" href="#">
              產品資訊
            </Link>
            <Link className="NavLink" to="/warranty">
              保固服務
            </Link>
            <Link className="NavLink" to="/aboutus">
              關於我們
            </Link>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Footer;
